const milisec_to_date = (date, format) => {
  switch (format) {
    case "yyyy-mm-dd":
      console.log(arrayDate);
      let arrayDate = date.split("-");
      const a = 0;
      arrayDate[a] = 32;
      console.log(arrayDate, "aa");

      break;

    default:
      break;
  }
};

export default milisec_to_date;
